The U.N. Security Council discusses Libya and then is expected to vote on a resolution stating that genuine autonomy for Western Sahara under Moroccan sovereignty &quot;could constitute a most feasible solution&quot; to the 50-year-long conflict. Morocco considers the territory as its own and is pitted against the Algeria-backed Polisario Front, which seeks an independent state. A U.S.-drafted text says genuine autonomy under Moroccan sovereignty &quot;could constitute a most feasible solution.&quot;

